import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom';
import { obtenerUsuario } from '../../services/supa';
import "./Login.css";

export const Login = () => {

    const [data, setData] = useState([]);
    const [username, setUsername] = useState('');
    const [password, setPassword] = useState('');

    let iniciarSesion = useNavigate();

    useEffect(() => {
        const fetchData = async () => {
            const usuarios = await obtenerUsuario();
            setData(usuarios);
        };
        fetchData();
    }, []);

    const handleSubmit = (e) => {
        e.preventDefault();

        // Busca en data si existe un usuario con el username y password ingresados
        const userExists = data.some(usuario => usuario.nombre_usuario === username && usuario.contrasenha === password);
        if (userExists) {
            iniciarSesion('/Layout'); // Si el usuario es válido, navega a '/Clientes'
        } else {
            alert('Usuario o contraseña incorrectos'); // O opcionalmente manejar este caso de otra manera
        }

    };

    return (


        <div className='login-container'>
            <form onSubmit={handleSubmit} className='form-container'>
                <div className='login-header'>

                </div>
                <div className='form-group'>
                    <label htmlFor="username">Usuario:</label>
                    <input
                        id="username"
                        type="text"
                        value={username}
                        onChange={e => setUsername(e.target.value)}
                    />
                </div>

                <div className='form-group'>
                    <label htmlFor="password">Contraseña:</label>
                    <input
                        id="password"
                        type="password"
                        value={password}
                        onChange={e => setPassword(e.target.value)}
                    />
                </div>

                <button type="submit">Iniciar sesión</button>

                <div className='login-footer'>
                    <p>Recupera tu Contraseña</p>
                </div>
            </form>
            <div className='login-info'>

                <div className='login-info-header'>
                    <img src={process.env.PUBLIC_URL + '/img/isotipo-arsheep.png'} alt='Logo Arsheep' />
                    <img src={process.env.PUBLIC_URL + '/img/logotipo-arsheep.png'} alt='Logo Arsheep' />
                </div>

                <div className='login-info-content'>
                    <h1>Bienvenido a Arsheep</h1>
                    <p>¡Bienvenido a Arsheep! La plataforma definitiva para la gestión de trabajos de mantenimiento industrial. Aquí, los equipos de mantenimiento encuentran el lugar perfecto para planificar, ejecutar y supervisar sus tareas de manera eficiente y organizada.</p>
                    <ul>
                        <li>
                            <p><strong>Gestión de Tareas y Proyectos:</strong>
                                Crea, asigna y sigue tareas y proyectos de mantenimiento fácilmente.</p>
                            <p><strong>Comunicación en Tiempo Real:</strong>
                                Mantente conectado con tus clientes a través de chats y comentarios.</p>
                            <p><strong>Comunicación en Tiempo Real:</strong>
                                Mantente conectado con tus clientes a través de chats y comentarios.</p>
                            <p><strong>Comunicación en Tiempo Real:</strong>
                                Mantente conectado con tus clientes a través de chats y comentarios.</p>
                        </li>
                    </ul>
                </div>

            </div>
        </div>

    );

}
